def chunks(lst, n):
    """Yield successive n-sized chunks from lst."""
    for i in range(0, len(lst), n):
        yield lst[i:i + n]


def calculate_new_sync_triple(current_list, new_list, symbol_len):
    if len(current_list) == 0:
        return [sum(new_list[0:symbol_len]), sum(new_list[symbol_len:symbol_len * 2]),
                sum(new_list[2 * symbol_len:symbol_len * 3])]
    else:
        return [current_list[0] + sum(new_list[0:symbol_len]),
                current_list[1] + sum(new_list[symbol_len:symbol_len * 2]),
                current_list[2] + sum(new_list[2 * symbol_len:symbol_len * 3])]


class Demodulator:
    def __init__(self, raw_data, symbol_len, modulation_bits, sync_seq_rep):
        self.raw_data = [int(i) for i in raw_data.strip().split(" ")]
        self.symbol_len = symbol_len
        self.modulation_bits = modulation_bits
        self.sync_seq_rep = sync_seq_rep
        self.num_of_symbols = pow(2, self.modulation_bits)
        self.full_sync_length = self.symbol_len * 3 * (self.num_of_symbols - 1) * self.sync_seq_rep
        self.sync_data = self.raw_data[0:self.full_sync_length]
        self.user_data = self.raw_data[self.full_sync_length:]
        self.demodulate_data = {}  # {"symbol" : [number_of_molecules, impact on next symbol, impact on next +1 symbol]}
        self.user_sums = []

    def calculate_thresholds(self):
        single_sync_seq_length = int(self.full_sync_length / self.sync_seq_rep)
        print("len sync data: ", len(self.sync_data))
        non_zero_sym_values = [str(i) for i in range(self.num_of_symbols - 1, 0, -1)]
